import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the sort/filter controls (contains the view toggle)
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Try to locate the "List View" button using a unique icon selector (second .view-btn in .view-toggle)
    const listViewBtn = await page.$('.sort-filter-controls .view-toggle .view-btn:nth-child(2)');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Scroll into view and click the List View button
    await listViewBtn.scrollIntoViewIfNeeded();
    await listViewBtn.click();

    // Wait for the products-list container to appear (list view mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    const listViewShot = path.join(screenshotsDir, 'step_2_list_view.png');
    await page.screenshot({ path: listViewShot });
    screenshots.push(listViewShot);

    // Extract a sample of product titles in list view to verify
    const productTitles = await page.$$eval('.products-list .product-card-list .product-title', nodes =>
      nodes.map(n => n.textContent.trim()).slice(0, 4)
    );

    return {
      success: true,
      action: "Switched to List View Mode using the view toggle and verified product list rendering.",
      extractedData: {
        productTitlesSample: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
